import "../../../index.css";

export default function SystemExplain() {
    return (
        <div style={{display:"flex",flexDirection:"column"}}>
            <button className="select_button_Container"
                style={{
                    marginLeft: "312px",
                    cursor: "pointer",
                    backgroundColor: "#4BAB26", // 클릭시 배경색 초록
                    color: "#FFFFFF", // 클릭시 글자색 흰색
                    fontSize:"13px",
                }}>
                시스템 이용법
            </button>
            <div  style={{
                    marginLeft: "312px",
                    border: "1px solid #E7E7E7",
                    width:"1180px",
                    height:"372px",
                    marginTop:"10px",
                    borderRadius:"8px"
               }}>
                <p 
                style={{
                    fontWeight:"bold",
                    fontSize:"10"
            }}> 매크로 프로그램 방지</p>
            </div>

        </div>
    );
}
